import React from 'react'
import State from './state'

let state = State
let ObnState = (newState) => {
    if(newState !== undefined && state !== undefined){
        this.setState(state = newState)
    return newState
    }else{
        console.log(state)
        return state
        
    }
}
export default ObnState
